import React, {Component} from 'react';
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableOpacity,
	ScrollView, FlatList, DeviceEventEmitter, PixelRatio, Dimensions,
} from 'react-native';
import {Divider, Icon} from 'react-native-elements';

let pixel = PixelRatio.get();
let screenW = Dimensions.get('window').width;

export default class Collection extends Component {
	constructor(props) {
		super(props);
		this.state = {
			dataList: []
		};
	}

	componentDidMount() {

		this.setState({
			dataList:[
				{id:1,name:'风信子2',price:'13.5',image:'https://s3.amazonaws.com/uifaces/faces/twitter/adhamdannaway/128.jpg'},
				{id:2,name:'风信子2',price:'13.5',image:'https://s3.amazonaws.com/uifaces/faces/twitter/adhamdannaway/128.jpg'},
				{id:3,name:'风信子2',price:'13.5',image:'data:image/jpeg;base64,'},
			]
		});
	}

	componentWillUnmount() {

	}

	_renderRow = ({item,index}) => {
		return(
			<View key={item.id} style={{height:100,flexDirection:'row',alignItems: 'center',}}>
				<Image style={styles.imgStyle}
					   source={{uri: item.image}}
				/>
				<View style={{flex:1,marginLeft: 20, justifyContent: 'space-around', height: 80}}>
					<Text style={{fontSize: 18}}>{item.name}</Text>
					<Text style={{fontSize: 15, color: 'red', textAlign: 'left'}}>¥{item.price}</Text>
				</View>
				<TouchableOpacity style={{
					borderWidth:1/pixel,
					borderColor: 'rgb(200,200,200)',
					justifyContent:'center',
					alignItems:'center',
					backgroundColor:'#fb3444',
					width: 30,
					height: 30,
					marginLeft: 5,
					borderRadius: 3
				}} onPress={()=>{
					let oldList = [...this.state.dataList];
					oldList.splice(oldList.findIndex(tItem => tItem.id === item.id), 1);
					this.setState({
						dataList: oldList
					});
				}}>
					<Icon name={'delete'} type='antdesign' size={20} color={'#ffffff'}/>
				</TouchableOpacity>
			</View>
		)
	}

	render() {
		return (
			<View style={styles.container}>
				<FlatList
					keyExtractor={(item, index) => index.toString()}
					renderItem={this._renderRow}
					data={this.state.dataList}
					ItemSeparatorComponent={()=><Divider/>}
				/>
			</View>
		);
	}
}
const styles = StyleSheet.create({
	container: {
		flex: 1,
		padding:10,
		backgroundColor: '#FFFFFF',
	},
	imgStyle: {
		width: 60,
		height: 60,
		borderRadius: 5
	},
});
